import "./App.css";
import { Route, Routes } from 'react-router-dom'
import ManageCourses from './screens/ManageCourses'

function App() {
  return (
    <div className='container-fluid'>
      <Routes>
       

        
          <Route path='ManageCourses' element={<ManageCourses />} />
          
       
      </Routes>

      
    </div>

      
      


  
  )}

export default App;
